			shellScript = "GIT_RELEASE_VERSION=$(git describe --tags --always --dirty --long)\nGIT_RELEASE_VERSION=${GIT_RELEASE_VERSION/-0-/-}\n\nCOMMITS=$(git rev-list HEAD | wc -l)\nCOMMITS=$(($COMMITS))\n\nmkdir -p \"$BUILD_DIR\"\n\necho \"#define CBL_STOPKIT_VERBOSE_VERSION ${GIT_RELEASE_VERSION#*v}\" > \"$BUILD_DIR/CBLStopKitVersions.h\"\necho \"#define CBL_STOPKIT_BUNDLE_VERSION ${COMMITS}\" >> \"$BUILD_DIR/CBLStopKitVersions.h\"\n\ndefaults write \"$BUILD_DIR/CBLStopKitVersions.plist\" CBLVerboseVersionString \"${GIT_RELEASE_VERSION#*v}\"\ndefaults write \"$BUILD_DIR/CBLStopKitVersions.plist\" CFBundleVersion \"${COMMITS}\"\n\necho \"Written to $BUILD_DIR/CBLStopKitVersions.h\"\n";
